    CampaignComponent.prototype.gtype = function (str) {
        //alert(str)
        //console.log($('#c1_1.2').attr('id'))
        //var e = document.getElementById("c1_1.2");
        //e.innerHTML = 'Found you';
        if (this.granttType == 'M') {
            //document.getElementById("myTd")["colSpan"] = this.colList.length;
            this.colNo = [];
            for (var i = 1; i < 13; ++i) {
                this.colNo.push(i);
            }
            this.cMax = 12;
            var then = this;
            setTimeout(function () {
                $('span[level="2"]').unbind("dragstart");
                //$('table td').unbind("dragenter dragover drop");
                $(document).unbind('dragenter drop');
                $('span[id^="C"]').unbind("dragend");
                then.setDrop();
            }, 300);
        }
        if (this.granttType == 'Q') {
            this.colNo = [];
            for (var i = 1; i < 29; ++i) {
                this.colNo.push(i);
            }
            this.cMax = 28;
            var then = this;
            setTimeout(function () {
                $('span[level="2"]').unbind("dragstart");
                //$('table td').unbind("dragenter dragover drop");
                $(document).unbind('dragenter drop');
                $('span[id^="C"]').unbind("dragend");
                then.setDrop();
            }, 300);
        }
        if (this.granttType == 'Y') {
            this.colNo = [];
            for (var i = 1; i < 8; ++i) {
                this.colNo.push(i);
            }
            this.cMax = 7;
            var then = this;
            setTimeout(function () {
                $('span[level="2"]').unbind("dragstart");
                //$('table td').unbind("dragenter dragover drop");
                $(document).unbind('dragenter drop');
                $('span[id^="C"]').unbind("dragend");
                then.setDrop();
            }, 300);
        }
    };
